import React from 'react';
import { Navbar } from 'react-bootstrap';

const Footer = () => {
  return (
    <Navbar fixed="bottom" expand="lg" variant="dark" bg="primary">
      <Navbar.Brand href="#">Brewskis Copyright 2020</Navbar.Brand>
    </Navbar>
  );
};
export default Footer;
